import { useEffect, useState } from 'react';
import './App.css';
import Goal from './components/goal';

// importera all FNs info fran API 
// MAppa dem
// Med click man ska fa mer info som sub-mal (target)

function App(props) {
  const [goalsFromAPI, setGoalsFromAPI]= useState([]); 
  

  useEffect(()=>{
    fetch ('https://unstats.un.org/SDGAPI/v1/sdg/Goal/List?includechildren=true')
  .then(
    (res)=> {
      return res.json();  
    }
      ).then(
        (data)=>{
          setGoalsFromAPI(data.target)
        }
      )
  }, []); 
  
 

  return (
    <div className="App">
     <h1>FN:s globala target </h1>
     {/* {goalsFromAPI.map((goals))} */}
    <main>
      {props.goals.map((goal, target)=>{ 
        return  < Goal goal ={goal} key={target}/>

      })} 

      )
    </main>
    

     <button >last mer</button>
    </div>
  );
}

export default App;
